import React, { useState } from 'react';
import './admindashboard.css';

const AdminDashboard = () => {
  const [view, setView] = useState('flights'); // Manage view between flights and passengers
  const [flights, setFlights] = useState([]);
  const [passengers, setPassengers] = useState([]);

  const [newFlight, setNewFlight] = useState({ flightNumber: '', destination: '', status: '' });
  const [newPassenger, setNewPassenger] = useState({ name: '', passengerNumber: '', flightId: '' });

  const handleAddFlight = () => {
    setFlights([...flights, newFlight]);
    setNewFlight({ flightNumber: '', destination: '', status: '' });
  };

  const handleAddPassenger = () => {
    setPassengers([...passengers, newPassenger]);
    setNewPassenger({ name: '', passengerNumber: '', flightId: '' });
  };

  const handleRemovePassenger = (index) => {
    setPassengers(passengers.filter((_, i) => i !== index));
  };

  return (
    <div className="admin-dashboard">
  <h1>Admin Dashboard</h1>

  <div className="top-container">
    <button onClick={() => setActiveSection("flights")} className={activeSection === "flights" ? "active-btn" : ""}>Flight</button>
    <button onClick={() => setActiveSection("passengers")} className={activeSection === "passengers" ? "active-btn" : ""}>Passenger</button>
  </div>

  {activeSection === "flights" && (
    <div className="section">
      <h2>Add Flight</h2>
      <div className="form-group">
        <div className="form-item">
          <label>Flight Number:</label>
          <input
            type="text"
            value={newFlight.flightNumber}
            onChange={(e) => setNewFlight({ ...newFlight, flightNumber: e.target.value })}
          />
        </div>
        <div className="form-item">
          <label>Destination:</label>
          <input
            type="text"
            value={newFlight.destination}
            onChange={(e) => setNewFlight({ ...newFlight, destination: e.target.value })}
          />
        </div>
        <div className="form-item">
          <label>Status:</label>
          <input
            type="text"
            value={newFlight.status}
            onChange={(e) => setNewFlight({ ...newFlight, status: e.target.value })}
          />
        </div>
        <button onClick={handleAddFlight}>+ Add Flight</button>
      </div>

      <div className="flights-list">
        <h3>Flights:</h3>
        {flights.map((flight, index) => (
          <div key={index}>
            Flight {flight.flightNumber} to {flight.destination} - {flight.status}
            <button onClick={() => setFlights(flights.filter((_, i) => i !== index))}>Cancel</button>
          </div>
        ))}
      </div>
    </div>
  )}

  {activeSection === "passengers" && (
    <div className="section">
      <h2>Add Passenger</h2>
      <div className="form-group">
        <div className="form-item">
          <label>Name:</label>
          <input
            type="text"
            value={newPassenger.name}
            onChange={(e) => setNewPassenger({ ...newPassenger, name: e.target.value })}
          />
        </div>
        <div className="form-item">
          <label>Passenger Number:</label>
          <input
            type="text"
            value={newPassenger.passengerNumber}
            onChange={(e) => setNewPassenger({ ...newPassenger, passengerNumber: e.target.value })}
          />
        </div>
        <div className="form-item">
          <label>Flight ID:</label>
          <input
            type="text"
            value={newPassenger.flightId}
            onChange={(e) => setNewPassenger({ ...newPassenger, flightId: e.target.value })}
          />
        </div>
        <button onClick={handleAddPassenger}>+ Add Passenger</button>
      </div>

      <div className="passengers-list">
        <h3>Passengers:</h3>
        {passengers.map((passenger, index) => (
          <div key={index}>
            {passenger.name} - Passport {passenger.passengerNumber}
            <button onClick={() => handleRemovePassenger(index)}>Remove</button>
          </div>
        ))}
      </div>
    </div>
  )}
</div>
  );
};

export default AdminDashboard;
